$(function ($) {
  "use strict";
  /*=========================== navbar ===========================*/
  $(function () {
    $('#main_navbar').bootnavbar();
  })
  $(".navbar-toggler").on("click", function () {
    $(this).toggleClass("active");
  });
  /*=========================== poup search ===========================*/
  $('a[href="#search"]').on('click', function (event) {
    event.preventDefault();
    $('#search').addClass('open');
    $('#search > form > input[type="search"]').focus();
  });

  $('#search, #search button.close').on('click keyup', function (event) {
    if (event.target == this || event.target.className == 'close' || event.keyCode == 27) {
      $(this).removeClass('open');
    }
  });
  /*=========================== poup search ===========================*/
});


$(function ($) {
  var defaults = {
    sm: 540,
    md: 720,
    lg: 960,
    xl: 1140,
    navbar_expand: 'lg'
  };
  $.fn.bootnavbar = function () {
    var screen_width = $(document).width();
    if (screen_width >= defaults.lg) {
      $(this).find('.dropdown').hover(function () {
        $(this).addClass('show');
        $(this).find('.dropdown-menu').first().addClass('show').addClass('animated fadeIn').one('animationend oAnimationEnd mozAnimationEnd webkitAnimationEnd', function () {
          $(this).removeClass('animated fadeIn');
        });
      }, function () {
        $(this).removeClass('show');
        $(this).find('.dropdown-menu').first().removeClass('show');
      });
    }
    $('.dropdown-menu a.dropdown-toggle').on('click', function (e) {
      if (!$(this).next().hasClass('show')) {
        $(this).parents('.dropdown-menu').first().find('.show').removeClass("show");
      }
      var $subMenu = $(this).next(".dropdown-menu");
      $subMenu.toggleClass('show');

      $(this).parents('li.nav-item.dropdown.show').on('hidden.bs.dropdown', function (e) {
        $('.dropdown-submenu .show').removeClass("show");
      });
      return false;
    });
  };
});

function block_copy() {
  $("body").bind("cut copy paste", //禁用剪切 复制 粘贴
      function () {
        $.preventDefault()
  }),
  $("body").on("contextmenu", //屏蔽右键菜单
    function () {
      return !1
  }),
  $("body").on("keydown",
    function ($) { //67-c  86-v  85-u 117-F6
      if ($.ctrlKey && (67 === $.keyCode || 86 === $.keyCode || 85 === $.keyCode || 117 === $.keyCode)) return !1
  })
}

function sider_nav() {
  $('.side-nav li a').click(function () {
    $(this).find('i').toggleClass('iconfont icon-arrow-right iconfont icon-arrow-btm');
  });
}

function add_modal_div() { //侧边栏弹出留言
  $('.modal_msg').click(function () {
    document.querySelector('header').className += ' modalblur';
    var x = document.querySelectorAll("section");
    var y = document.querySelectorAll("article");
    var m, n;
    for (m = 0; m < x.length; m++) {
      x[m].className += ' modalblur';
    }
    for (n = 0; n < y.length; n++) {
      y[n].className += ' modalblur';
    }
    $("#footer .wpcf7").wrap("<div class='pop_msg modal fade' id='msg_modal'><div class='modal-dialog modal-dialog-centered'><div class='modal-content'></div></div></div>"); //用自定的标签包括住表单
    $("<div class='modal-header'><h4 class='modal-title'>Online Message</h4><button type='button' class='close' data-dismiss='modal' aria-label='Close'><span aria-hidden='true'>X</span></button></div>").insertBefore("#footer .wpcf7"); //在表单前插入头部信息
    $("<button type='button' class='dismiss_pop btn btn-secondary' data-dismiss='modal'>Close</button>").insertBefore("#footer .submit_btn");
	$("#footer #usubject").val("Footer Pop Message");
  });
}

function CounterNum(){$(".counter").each(function(){var t=$(this),a=t.attr("data-count");$({countNum:t.text()}).animate({countNum:a},{duration:6e3,easing:"linear",step:function(){t.text(Math.floor(this.countNum))},complete:function(){t.text(this.countNum)}})})}


function topsearch() {
			var $search = $('#search');
			if ($search.length > 0) {
				var searchBtn = $('#btn-search'),
				searchBtnClose = $('#btn-search-close'),
				searchInput = $search.find('.form-control');
				function openSearch() {
					$('body').addClass('search-open');
					searchInput.focus();
				}
				function closeSearch() {
					$('body').removeClass('search-open');
					searchInput.value = '';
				}
				searchBtn.on('click',
				function() {
					openSearch();
					return false;
				});
				searchBtnClose.on('click',
				function() {
					closeSearch();
					return false;
				});
				document.addEventListener('keyup',
				function(ev) {
					if (ev.keyCode == 27) {
						closeSearch();
					}
				});
			}
		}
			
			

function ToTop() {
  $(".scrollup").on("click", function () {
    return $("html, body").animate({
          scrollTop: 0
        },
        600),
      !1
  });
}
$(window).on("scroll", function () {
  $(this).scrollTop() > 100 ? $(".nav_main").addClass("sticky") : $(".nav_main").removeClass("sticky") //头部固定
  $(this).scrollTop() > 300 ? $(".scrollup").addClass("show-totop") : $(".scrollup").removeClass("show-totop") //移动到页面顶部
  //$(this).scrollTop() > 880 ? $(".nav-tabs").addClass("fixtab") : $(".nav-tabs").removeClass("fixtab") //头部固定
}) 
